import React, { useState } from "react";
import AddStu from "./AddStu";
import Reg from "./Reg";
import TestSys from "./TestSys";
import { BrowserRouter, Routes, Route, NavLink, Switch } from "react-router-dom";

export const Nav2 = () => {
  return (
    <>
      <nav class="navbar navbar-expand-lg bg-body-tertiary p-0">
        <div class="container-fluid  shadow">
          <div class="collapse navbar-collapse" id="navbarNav">
            <ul class="navbar-nav">
              <li class="nav-item">
                <button class="nav-link active" aria-current="page">
                  Attendance
                </button>
              </li>
              <li class="nav-item">
                <button class="nav-link">Add Student</button>
              </li>
              <li class="nav-item">
                <button class="nav-link">Test System</button>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <Switch>
        <Route exact pat/>
      </Switch>
    </>
  );
};

export default Nav2;
